//Method for Initializing graph later

function ticked() {
  tickCount++;
  //console.log(tickCount);

  document.getElementById("iterationCountValue").textContent =
    "Iterations: " + tickCount;



  //Computation time calculation
    endComputationTime = new Date().getTime();
    document.getElementById("computationTimeValue").textContent =
      "Eff.Comp.Time: " + (endComputationTime - startComputationTime) + " ms";



    

  //Restyling links color
  var distanceError=0;
  var updatedLinkColorMap =  new Map();
  var thresholdLinkError = 3;
  for(var i=0; i<links.length; i++){

    var idealDistance = links[i].distance;
    var currentDistance = Math.sqrt((links[i].source.x-links[i].target.x)*(links[i].source.x-links[i].target.x)+
    (links[i].source.y-links[i].target.y)*(links[i].source.y-links[i].target.y));  

    var linkDistanceError = (Math.abs(idealDistance-currentDistance)/idealDistance);
    //console.log(linkDistanceError);
    if(linkDistanceError>= thresholdLinkError){
      updatedLinkColorMap.set(links[i].index,"#ff0000");
      console.log("bad link");
    }
    else{
      updatedLinkColorMap.set(links[i].index,"#00ff00");
      console.log("good link");
    }
    distanceError+=Math.abs(idealDistance-currentDistance)/idealDistance;

  }
  distanceError/=links.length;

  document.getElementById("errorValue").textContent = "Relative Mean Error: " + distanceError;
  //console.log(updatedLinkColorMap);
  Graph.linkColor(function(d){
    return updatedLinkColorMap.get(d.index);});

}



var worldPos;
//Defining the Rdial Repulsion Force
RadialRepulsionForce.initialize = function(_) {
  nodes = _;
};

function RadialRepulsionForce(alpha) {
  if (radialRepulsionSliderValue > 0) {
      worldPos= nodes[nodes.length-1];
      var thetaArray = [];

      //Appending theta to thetaArray in radians (-pi,pi] corresponding to each node
      for (var i = 0, n = nodes.length-1, node; i < n; i++) {
        node = nodes[i];
        var theta = Math.atan2(node.y - worldPos.y, node.x - worldPos.x);
        thetaArray.push({ theta: theta, index: i });
        console.log(thetaArray);
      }

      //var idealAngle = 4 * Math.PI / (nodes.length);
      //Sorting the angles
      thetaArray.sort(function(a, b) {
        return a.theta - b.theta;
      });

      //Force vector field mimicing radial replusion between consecutive pairs of angular-sorted nodes

      for (
        var i = 0,
          n = thetaArray.length,
          node1,
          node2,
          k = 1/10 * alpha * radialRepulsionSliderValue;
        i < n;
        i++
      ) {
          var j=(i+1)%(n);

          node1 = nodes[thetaArray[i].index];
          node2 = nodes[thetaArray[j].index];

          var node1Relative = {
            x: node1.x - worldPos.x,
            y: node1.y - worldPos.y
          };
          var node2Relative = {
            x: node2.x - worldPos.x,
            y: node2.y - worldPos.y
          };

          var modulusNode1 = Math.sqrt(
            node1Relative.x * node1Relative.x +
              node1Relative.y * node1Relative.y
          );
          var modulusNode2 = Math.sqrt(
            node2Relative.x * node2Relative.x +
              node2Relative.y * node2Relative.y 
          );

          //console.log(modulusNode1);
          

          
          //Initializing radial bounds for each node
          var node1RadialBound = 50;
          var node2RadialBound = 50;
          //console.log(node1RadialBound + "  "+ modulusNode1 +"  "+"radial bounds: " + node1RadialBound+ "  "+ modulusNode2);

          var angleBetweenNode1Node2Realtive = Math.abs(
            Math.acos(
              (node1Relative.x * node2Relative.x +
                node1Relative.y * node2Relative.y)/
                (modulusNode1 * modulusNode2)
            )
          );

          //Computing specific ideal angle
          var idealAngle = 
            Math.atan2(node1RadialBound, modulusNode1) +
            Math.atan2(node2RadialBound, modulusNode2);
    

          var deltaTheta = angleBetweenNode1Node2Realtive - (idealAngle)*(1.15);

          console.log(deltaTheta);


           
            var unitNode1 = {x: node1Relative.x * 100 / modulusNode1, y: node1Relative.y*100/ modulusNode1};
            var unitNode2 = {x: node2Relative.x * 100/ modulusNode2, y: node2Relative.y *100/ modulusNode2};
           

            if (Math.abs(unitNode1.x -unitNode2.x) >= 10e-4  && Math.abs(unitNode1.y -unitNode2.y) >=10e-4){
              if(deltaTheta<0){
                //Defining force for node1
                node1.vx -= 1 *k *deltaTheta *(unitNode1.y);
                node1.vy -= 1 *k *deltaTheta *(-unitNode1.x);
                //Defining force for node2
                node2.vx -= 1 * k *deltaTheta *(-unitNode2.y);
                node2.vy -= 1 * k *deltaTheta *(unitNode2.x);
                }
    
                else{
                 //Defining force for node1
                node1.vx -= 0.01 *k *deltaTheta *(unitNode1.y);
                node1.vy -= 0.01 *k *deltaTheta *(-unitNode1.x);
                //Defining force for node2
                node2.vx -= 0.01 * k *deltaTheta *(-unitNode2.y);
                node2.vy -= 0.01 * k *deltaTheta *(unitNode2.x);
                }
            }

            else{

              console.log("almost linear");
              //Defining force for node1
              node1.vx*=2
              node1.vy *=2
              //Defining force for node2
              node2.vx *=2
              node2.vy *=2

            }
            
           
          

       
      }

     

  
  }
}


var rangeSlider = function() {
  var slider = $(".range-slider"),
    range = $(".range-slider__range"),
    value = $(".range-slider__value");

  slider.each(function() {
    value.each(function() {
      var value = $(this)
        .prev()
        .attr("value");
      $(this).html(value);
    });

    range.on("input", function() {
      $(this)
        .next(value)
        .html(this.value);

        linkStrengthSliderValue =
        document.getElementById("linkStrengthValue").value / 100;
        radialRepulsionSliderValue =
        document.getElementById("radialForceStrengthValue").value / 100;

        console.log("lambda" + linkStrengthSliderValue);
        console.log("lambda" +radialRepulsionSliderValue);
        StartSimulation();
      
    });
  });
};

